import React from 'react';
import { Link } from 'react-router-dom';
import "./blog.css"

function Blog(){

return(<>
 <nav>
        <ul>
          <li><Link to="/">Create</Link></li>
          <li><Link to="/Blog">Blog</Link></li>
        </ul>
      </nav>
      
      </>);

}

export default Blog;
